import React from "react";
import styles from "./index.module.css"
import RegistrationForm from "../../Camponents/Registration_form/RegistrationForm";
import AuthorizationForm from "../../Camponents/AuthorizationForm/AuthorizationForm";
import DouthReqestForm from "../../Camponents/DoughForm/DoughReqestForm";
import IngredientForm from "../../Camponents/IngredienForm/IngredientForm";
import IngredientListPage from "../../Camponents/IngredientListPage/IngredientListPage";
import PizzaForm from "../../Camponents/PizzaForms/PizzaForm";
import GetRevievs from "../../Camponents/GetReviev/GetRevievs";
impo

const HomePage=()=>{
    return(
        <div className={styles.mainContainer}>
            <h1>Pizza Craft</h1>
            <div className={styles.formContainer}>
            <PizzaForm></PizzaForm>
        </div>
        </div>
    )
}
export default HomePage;
